export interface CityName {
  city: string;
}

export async function CityCoordinates(cityName: string) {
  let response = await fetch(
    `https://api.api-ninjas.com/v1/geocoding?city=${props.city}`
  );

  if (!response.ok) {
    return null;
  }

  let responseData = (await response.json()) as string;

  return responseData;
}
